node.text:
I am a blessed man… I have been thru trials and tribulations, I’ve been on mtn tops and valleys, (a lot of valleys) I’ve made plenty of bad decisions in my life… but one thing I know for sure, is that God is faithful, when you get real with Him, His love brings clarity, humility, forgiveness and joy. And when you put Him first, miracles happen. My family is a miracle. The love we have, the times we share and the fun we all have together is a miracle. So to the one reading  this feeling hopeless, I’ve been there. Feeling undeserving of love, I’ve been there… the one trapped in addiction unsure if you’ll ever get free, I’ve been there… and I can tell you, don’t give up. Get real with yourself, and get real with God. And then take the first step. Whatever that may be, just do it. You’ll know what He’s leading you to do… and His plans for you are without a doubt, amazing… 
PS. Life is pretty incredible with these beautiful ladies! 🙌🏽❤️🙏🏽
